import React from 'react'

function Table2(images) {
    const rows = [];
  
    for (let i = 0; i < 5; i++) {
      const cells = [];
  
      for (let j = 0; j < 5; j++) {
        const imageIndex = i * 5 + j;
        cells.push(
          <td key={j}>
            <img src={images[imageIndex]} alt={`Image ${imageIndex}`} style={{ width: 50, height: 50 }} />
          </td>
        );
      }
  
      rows.push(
        <tr key={i}>
          {cells}
        </tr>
      );
    }
  
    return rows;
  }

  
  export default Table2;
